@-moz-document url-prefix("file:///") {
 



body {
        background: #282828 url("data:image/jpg;base64,") repeat !important;
        color: #fff !important;
        font-family: arial, helvetica, sans-serif !important;
        font-size: 12px !important;
}

.rofl { 
        font-size: 15px !important;
        color: #ccc !important;
        margin-left: 5px !important;        
}

/* close - btn */
.roflox {
        background: #000 url(data:image/png;base64,) 99% no-repeat !important;
        border: 1px solid #666 !important;
         min-height: 28px !important;
        width: 85% !important;
         position: relative !important;
        margin: 6px auto 6px auto !important; 
}

.roflox:hover {
	background: #000 url(data:image/png;base64,) 99% no-repeat !important;
}	


.bod {
	background-color: #000 !important;
	border: 1px solid #666 !important;
    	width: 83.5% !important;
    	position: relative !important;
    	padding: 7px 10px 10px 10px !important;
    	margin-top: 19px !important;
    	margin-right: auto !important;
    	margin-left: auto !important;
    	-moz-border-radius: 10px !important;
}

/* dLall */
.desc2 img {
    	opacity: 0.5 !important;
        margin-bottom: 5px !important;
}

.desc2 img:hover {
    	opacity: 1.0 !important;
}

/* unplug - icon */
IMG[alt="Fishy Icon"] {
	background: #000 url(data:image/png;base64,) !important;
	width: 0 !important;
	height: 121px !important;           
	padding-left: 100px !important;
	margin-right: 1px !important;
	border: 1px solid #353535 !important; 
}

IMG[alt="Fishy Icon"]:hover {
    	background-color: #333 !important;
    	border: 1px solid #ff6600 !important;
}

/* option - btn */
IMG[alt="Options"] {
	background: url(data:image/png;base64,) no-repeat !important;
    	width: 0 !important;
    	height: 19px !important;           
    	padding-left: 23px !important;
    	opacity: 0.5 !important;
}

IMG[alt="Options"]:hover {
    	opacity: 1.0 !important;
}


IMG[alt="Options"]:active {
    	opacity: 0.3 !important;
}

/* adjust a bit - coloum / create separator */

.lair { 
    	border-bottom: 1px dotted #444 !important;
    	width: 80% !important; 
    	padding-bottom: 10px !important;
    	margin-bottom: 5px !important;
}

/* suggest - bottom */
.booth {
        color: Highlight !important;
        font-size: 11px !important;
    	background-color: #282828 !important;
    	border-color: #444 !important;
        
}

/* Common to All links */
a { text-decoration: none !important; }

a:link {
	font-size: 14px !important;
        font-weight: bold !important;
	color: #82BDFF !important; /* lightblue */
}

a:link:hover {
	color: #ff6600 !important; /* darkorange */
}

a:visited {
	color: #33FFFF !important; /* greenishhigh */
}

a:hover, 
a:visited:hover {
    	color: #1689FF !important; /* mediumblue */
 }

.desc_notes {
        font-size: 12px !important;
        text-align: justify !important;
        width: 80% !important;
}

.count {
       color: HighlightText !important;
       font-size: 13px !important;
       font-weight: bold !important;
       margin-top: 10px !important;
}



}
